inline void update_short_bg(unsigned int samples[3][IMG_WIDTH][IMG_HEIGHT][NUM_SAMPLES], 
	const IplImage *bgr, const int pos, const IplImage *maskIpl, const bool useMask, 
	const int tlx, const int tly, const int brx, const int bry) {
	const int p = pos % NUM_SAMPLES;
	if (useMask) {
		#pragma omp parallel for
		for (int r=tly; r<bry; r++) {
			for (int c=tlx; c<brx; c++) {

				if (maskIpl->imageData[r*maskIpl->widthStep + c] != 0) {
					samples[0][c][r][p] = bgr->imageData[r*bgr->widthStep + c*3 + 2];
					samples[1][c][r][p] = bgr->imageData[r*bgr->widthStep + c*3 + 1];
					samples[2][c][r][p] = bgr->imageData[r*bgr->widthStep + c*3 + 0];
				}
			}
		}
	}
	else {
		#pragma omp parallel for
		for (int r=0; r<maskIpl->height; r++) {
			for (int c=0; c<maskIpl->width; c++) {
				samples[0][c][r][p] = bgr->imageData[r*bgr->widthStep + c*3 + 2];
				samples[1][c][r][p] = bgr->imageData[r*bgr->widthStep + c*3 + 1];
				samples[2][c][r][p] = bgr->imageData[r*bgr->widthStep + c*3 + 0];
			}
		}
	}
}


inline void update_long_bg(unsigned int samples[3][IMG_WIDTH][IMG_HEIGHT][NUM_SAMPLES], 
	const IplImage *bgr, const int pos, const int tlx, const int tly, const int brx, const int bry) {
	const int p = pos % NUM_SAMPLES;
	#pragma omp parallel for
	for (int r=tly; r<bry; r++) {
		for (int c=tlx; c<brx; c++) {
			samples[0][c][r][p] = bgr->imageData[r*bgr->widthStep + c*3 + 2];
			samples[1][c][r][p] = bgr->imageData[r*bgr->widthStep + c*3 + 1];
			samples[2][c][r][p] = bgr->imageData[r*bgr->widthStep + c*3 + 0];
		}
	}
}


inline float bg_pixel_prob(const unsigned int pixel, const unsigned int sample) {
	// Estimate pdf
	unsigned int diff = abs((int)pixel - (int)sample);
	unsigned char udiff = (unsigned char)diff;
	unsigned char umedian = 5; // <-- change this to the avg of n samples 
	return lut[udiff][umedian];
}


inline unsigned int bg_pixel_mask(const float thresh,
	const unsigned int pixelR, const unsigned int pixelG, const unsigned int pixelB, 
	const unsigned int shortSamplesR[], const unsigned int shortSamplesG[], const unsigned int shortSamplesB[],
	const unsigned int longSamplesR[], const unsigned int longSamplesG[], const unsigned int longSamplesB[]) {
	float shortSum = 0.0f;
	float longSum = 0.0f;
	for (int i=0; i<NUM_SAMPLES && shortSum < thresh && longSum < thresh; i++) {
		float shortR = bg_pixel_prob(pixelR, shortSamplesR[i]);
		float shortG = bg_pixel_prob(pixelG, shortSamplesG[i]);
		float shortB = bg_pixel_prob(pixelB, shortSamplesB[i]);
		float longR = bg_pixel_prob(pixelR, longSamplesR[i]);
		float longG = bg_pixel_prob(pixelG, longSamplesG[i]);
		float longB = bg_pixel_prob(pixelB, longSamplesB[i]);
		shortSum += shortR*shortG*shortB;
		longSum += longR*longG*longB;
	}
	return (shortSum >= thresh || longSum >= thresh ? 0: 255);
}


inline void update(unsigned int longSamples[3][IMG_WIDTH][IMG_HEIGHT][NUM_SAMPLES], 
	unsigned int shortSamples[3][IMG_WIDTH][IMG_HEIGHT][NUM_SAMPLES], IplImage *maskIpl,
	int *count, const int shortUpdateFreq, const int longUpdateFreq, const IplImage *bgr, 
	const int x, const int y, const int w, const int h, const float thresh) {
	// Make sure we don't pass any boundaries
	const int tlx = max(0, x);
	const int tly = max(0, y);
	const int brx = min(maskIpl->width, x+w);
	const int bry = min(maskIpl->height, y+h);

	// Update the mask
	const float norThresh = thresh*NUM_SAMPLES;
	#pragma omp parallel for
	for (int r=tly; r<bry; r++) {
		for (int c=tlx; c<brx; c++) {
			maskIpl->imageData[r*maskIpl->widthStep + c] = bg_pixel_mask(norThresh, 
				bgr->imageData[r*bgr->widthStep + c*3 + 2], 
				bgr->imageData[r*bgr->widthStep + c*3 + 1], 
				bgr->imageData[r*bgr->widthStep + c*3 + 0], 
				shortSamples[0][c][r], shortSamples[1][c][r], shortSamples[2][c][r],
				longSamples[0][c][r], longSamples[1][c][r], longSamples[2][c][r]);
		}
	}

	// Update the history
	if (*count % shortUpdateFreq == 0 || *count % shortUpdateFreq == 1)
		update_short_bg(shortSamples, bgr, *count, maskIpl, *count > NUM_SAMPLES, tlx, tly, brx, bry);
	if (*count % longUpdateFreq == 0 || *count % longUpdateFreq == 1)
		update_long_bg(longSamples, bgr, *count, tlx, tly, brx, bry);
	*count = *count + 1;
}


void BgSub::update_mask(IplImage *bgr, int x, int y, int w, int h, float thresh) {
	// Request an update
	pthread_mutex_lock(&_mutex);
	_update = 1;
	_updateX = x;
	_updateY = y;
	_updateW = w;
	_updateH = h;
	_updateThresh = thresh;
	_updateImg = bgr;
	pthread_cond_signal(&_cv_update);
	pthread_mutex_unlock(&_mutex);
}


void BgSub::get_center_of_mass(const int x, const int y, const int w, const int h, 
	float *xAvg, float *yAvg, float *fillPercent) {
	// Make sure we don't pass any boundaries
	const int tlx = max(0, x);
	const int tly = max(0, y);
	const int brx = min(_maskIpl->width, x+w);
	const int bry = min(_maskIpl->height, y+h);

	// Initialize
	*xAvg = 0;
	*yAvg = 0;

	// Get our mutex
	pthread_mutex_lock(&_mutex);

	// Wait for any pending updates to be completed
	while (_end == 0 && _update == 1) 
		pthread_cond_wait(&_cv_updated, &_mutex);

	// Count the white pixels
	int n = 0;
	for (int r=tly; r<bry; r++) {
		for (int c=tlx; c<brx; c++) {
			if (((unsigned int)_maskIpl->imageData[r*_maskIpl->widthStep+c]) > ((unsigned int)250)) {
				*xAvg += c;
				*yAvg += r;
				n++;
			}
		}
	}

	*xAvg /= max(1, n);
	*yAvg /= max(1, n);
	*fillPercent = n/(float)((brx-tlx)*(bry-tly));

	// Release our mutex
	pthread_mutex_unlock(&_mutex);
}


void *update_fxn(void *arg) {
	BgSub *bg = (BgSub *)arg;

	// Get our mutex
	pthread_mutex_lock(&bg->_mutex);

	// Continue until the end
	while (bg->_end == 0) {
		// Wait for an update to be requested
		while (bg->_end == 0 && bg->_update == 0) 
			pthread_cond_wait(&bg->_cv_update, &bg->_mutex);
TS_STAMP(bgsub, 0);
		// Update the mask
		if (bg->_end == 0) {
			update(bg->_longSamples, bg->_shortSamples, bg->_maskIpl, &bg->_count,
				bg->_shortUpdate, bg->_longUpdate, bg->_updateImg, bg->_updateX, 
				bg->_updateY, bg->_updateW, bg->_updateH, bg->_updateThresh);
		}

//cvNamedWindow("mask", 0/*CV_WINDOW_AUTOSIZE*/ );
//cvShowImage("mask", bg->_maskIpl);
//cvWaitKey(3);

		// Keep track that we're done updating
		bg->_update = 0;
		pthread_cond_signal(&bg->_cv_updated);
TS_STAMP(bgsub, 1);
TC_ACCRUE(bgsub, 0, 1, 0);
	}
	// Release our mutex
	pthread_mutex_unlock(&bg->_mutex);

printf("bgsub: %f (%ld)\n", TC_ITER_AVG(bgsub, 0),  TC_ITERS(bgsub, 0));

	return NULL;
}


BgSub::BgSub(int w, int h, int fps) {
	_maskIpl = NULL;
	_width = w;
	_height = h;
	
	// Set the update frequencies
	_shortUpdate = fps/15 < 2 ? 2 : fps/15;
	_longUpdate = _shortUpdate * 10;
}


bool BgSub::init() {
	// Initialize locals
	_count = 0;
	_update = 0;

	// Create the condition variables and mutex
	pthread_mutex_init(&_mutex, NULL);
	pthread_cond_init (&_cv_update, NULL);
	pthread_cond_init (&_cv_updated, NULL);

	// Validate the frame size and parameters
	if (_width > IMG_WIDTH || _height > IMG_HEIGHT) {
        printf("ERROR: Frame size (%d,%d) is greater than expected size (%d,%d).\n", 
			_width, _height, IMG_WIDTH, IMG_HEIGHT);
        return false;
	}

	// Initialize samples
	for (int r=0; r<IMG_WIDTH; r++) {
		for (int c=0; c<IMG_HEIGHT; c++) {
			for (int i=0; i<3; i++) {
				for (int j=0; j < NUM_SAMPLES; j++) {
					_shortSamples[i][c][r][j] = 1;
					_longSamples[i][c][r][j] = 1;
				}
			}
		}
	}

	// Create the mask image
	_maskIpl = cvCreateImage(cvSize(_width, _height), IPL_DEPTH_8U, 1);

    return true;
}


void BgSub::start() {
	// Initialize the stop signal
	_end = 0;

	// Create and start the threads
	pthread_create(&_thread, NULL, update_fxn, this);
}


void BgSub::stop() {
	// Signal stop
	_end = 1;

	// Release any waiting threads
	pthread_mutex_lock(&_mutex);
	pthread_cond_signal(&_cv_update);
	pthread_cond_signal(&_cv_updated);
	pthread_mutex_unlock(&_mutex);

	// Wait until the thread is done
    pthread_join(_thread, NULL);
}



